import {createRouter,createMemoryHistory} from 'vue-router'

const Foo = "<div>foo</div>"
const Bar = "<div>bar</div>"


const routers = [
    {
        path : '/foo',
        component : Foo
    },
    {
        path : '/bar',
        component : Bar,
    }
]

const router = createRouter({
    history : createMemoryHistory(),
    routers
})

export default router
